  true,\n\t\"url\": null,\n\t\"notes\": \"The Nimbus IV was successfully launched
  on April 8 1970.  Nimbus IV Temperature-Humidity Infrared Radiometer (THIR) experiment
  replaced the Nimbus III MRIR and HRIR experiments. n      n      The THIR is a two
  channel high resolution scanning radiometer designed to perform two major functions:n
  \     n      o 10.5 u2013 12.5 micron channel provides both day and night cloud
  top or surface temperatures.  The ground resolution at the sub-point is 8km and
  operates day and night.n      n      o 6.7 micron channel gives information on the
  moisture content of the upper troposphere and stratosphere and the location of jet
  streams and frontal systems. The water vapor  channel has a resolution of the sub-point
  is 22 km and operates mostly at night.n      n      The Nimbus IV THIR 6.7 micron
  channel data are available from ??  (Day of  year ??) through ?? (Day of year ??).n
  \     n      The Nimbus IV  THIR 6.7 micron channel data are stored in a binary
  TAP format (proprietary Tape emulated format). n      n      n      [Summary Extracted
  from the Nimbus IV users' guide]\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
